import "./About.css";
import { Link } from 'react-router-dom';
import styled from "styled-components";

const NavUnlisted = styled.ul`
  text-decoration: none;
`;

const StyledLink = styled(Link)`
  color: Blue;
  text-decoration: none;
`

const Education = () => {
    return(
        <div className="about">
            <NavUnlisted>
                <StyledLink to="/">Home</StyledLink>
                <StyledLink to="/projects">Projects</StyledLink>
                <StyledLink to="/experience">Experience</StyledLink>
                <form action="https://www.docdroid.net/CFYS6UG/doina-colun-resume-copy-pdf">
                    <button type="submit">Resume</button>
                </form>
            </NavUnlisted>
            <div className="about-me">
                <p>Hi, My name is Doina Colun, and I am a passionate software engineer with a deep-rooted love for solving complex problems with innovative solutions. 
                I am thrilled to embark on my career in the industry after recently graduating from Ada Developers Academy with a certificate in Full Stack Web Development and Computer Science.
                <br/><br/> Throughout my studies, I have honed my skills in a variety of programming languages, including Python, JavaScript, Scala, and Java, and I have a strong foundation in data structures and algorithms. 
                I am well-versed in agile software development methodologies, which have enabled me to work collaboratively with others to deliver high-quality projects on time.
                <br/><br/> During my time as a backend software engineer intern at Amazon, I gained valuable real-world experience, 
                which has allowed me to develop a keen understanding of how to approach and solve challenging problems.
                <br/><br/> I have a particular interest in web development and have experience building websites using frameworks such as React. 
                I take pride in creating dynamic, interactive interfaces that engage users and simplify their lives.
                <br/><br/> Aside from programming, I enjoy reading, cooking, hiking, traveling, and exploring new technologies. 
                I believe that constant learning and growth are crucial to stay relevant in the ever-changing field of software engineering.
                <br/><br/> I am eager to join a team that values innovation, collaboration, and growth. 
                If you are interested in learning more about my experience and skills, please do not hesitate to reach out. I look forward to connecting with you!
                </p>
            </div>
        </div>
    )  
}

export default Education;
